<div class="text-container"><span id="t1_14" class="t s0_14"> רפואית</span>
<span id="t2_14" class="t s1_14"> אם הכל תקין</span><span id="t3_14" class="t s1_14">, </span><span id="t4_14" class="t s1_14"> לחצו כאן</span><span id="t5_14" class="t s1_14">): </span>
<span id="t6_14" class="t s2_14"> </span><span id="t7_14" class="t s3_14"> עו</span><span id="t8_14" class="t s4_14">" </span><span id="t9_14" class="t s3_14"> ש של שלושת החודשים האחרונים של כל החשבונות שלכם</span>
<span id="ta_14" class="t s2_14"> </span><span id="tb_14" class="t s3_14"> אישור תשלום מביטוח לאומי</span>
<span id="tc_14" class="t s2_14"> </span><span id="td_14" class="t s3_14"> אישור הכרה מביטוח לאומי על אי כושר עבודה</span></div>
